import React from 'react';

const Common = () => {
    return (
        <div>
            <div style={{ textAlign: "center", marginTop: 120 }}>
                <h1>Choose Your Option</h1>
                <hr className="w-50 mx-auto" />
            </div>
        </div>
    );
};

export default Common;
